import React from 'react';
import styled from '@emotion/styled';
import { Input } from './styledElements';

function SearchBar() {
    const SearchDiv = styled.div`
        width: 50vw;
        height: 2rem;
        top: 150px;
        margin-right: auto;
        margin-left: auto;
        margin-top: 20px;
        margin-bottom: 20px;
        border: none;
        border-bottom: solid 1px #212a31;
    `;

    return (
        <SearchDiv>
            <Input style={{width: '100%'}} type="text" name="search" id='search' placeholder='Search' />
        </SearchDiv>
    )
}

export default SearchBar;
